import React from 'react';
import { connect } from 'react-redux';
import logo from '../../assets/logo.png';
import { Link } from 'react-router-dom';

class Dashboard extends React.Component {
  render() {
    return (
      <div className="centered">
        <img src={logo} />
      </div>
    );
  }
}
